Pirmajame kėlinyje Alytaus rankininkai sugebėjo primesti vilniečiams lėtesnį žaidimo tempą ir stabdyti jų greitas atakas. Būtent to dėka prieš ilgąją pertrauką „Varsa-Stronglasas“ turėjo trijų įvarčių persvarą (16:13). Vis tik antrajame kėlinyje vilniečiai jau pajautė savąjį žaidimą, o ekipą kaip jau įprasta į priekį vedė Valdo Drabavičiaus ir Tomo Bernatavičiaus tandemas. Nors likus iki rungtynių pabaigos 7 minutėms „VHC Šviesa“ jau pirmavo 29:25, tačiau intriga išliko iki paskutiniųjų rungtynių akimirkų. Pradėjus tiksėti paskutinei susitikimo minutei vilniečių persvara siekė jau tik vieną įvartį (31:30) ir abi komandos metė po 7 metrų baudinį, tačiau nei vieniems nei kitiems savųjų progų realizuoti nepavyko ir susitikimas baigėsi vilniečių pergale 31:30. „Rungtynės mums nepavyko, manau kad galėjo pasibaigti ir kitaip. Įsivėlėme į jiems naudingą lėtesnį žaidimą. Mes šį sezoną prisitaikome prie kitų komandų tokio žaidimo. Gale rungtynių ir sėkmės faktorius lydėjo. Priešininkai šiandieną pasirinko žaisti daugiau su vyresniais, pasirinko tokią taktiką. Mes likus žaisti antrame kėlinyje penkiomis minutėmis, kai turėjome keturių įvarčių persvarą, turėjome baigti solidžiau. Gerai, kad laimėjome“, – po rungtynių sakė „VHC Šviesos“ treneris Raimondas Maldžius. „Rungtynės pasižymėjo didele įtampa, laimėjo pajėgi komanda iš Vilniaus. Jų ekipa yra jaunesnė ir tos jėgos prieš rato pabaigą išlikę didesnės. Mes šiandien atrodėme daugiau pavargę, o ir pabaigoje neišnaudojome kelių šimtaprocentinių progų, kuriose turėjome įmesti įvarčius, bet to nepadarėme ir tai nulėmė svečių pergalę“, – pabrėžė alytiškių treneris Eugenijus Gimbutas. Turnyro lentelė (vieta, komanda, taškai) Klaipėdos „Dragūno“ ekipa namuose priėmusi svečius iš sostinės „Vilniaus“ rankininkus didesnių problemų neturėjo. Jau susitikimo pradžioje klaipėdiečiai „spurtavo“ 4:0 ir visų rungtynių metu išsilaikė priekyje. Tiesa, pirmojo kėlinio viduryje „Vilniui“ buvo pavykę aplyginti žaidimą ir „Dragūno“ persvara nebeaugo, tačiau pačioje pirmojo kėlinio pabaigoje klaipėdiečiai surengė kelias rezultatyvias atakas ir į pertrauką išėjo pirmaudami 22:14. Po ilgosios pertraukos prie puikaus Klaipėdos „Dragūno“ puolimo dar prisidėjo ir puikiai vartus gynęs Benas Vaicekauskas ir nors kartas nuo karto vilniečiams pavykdavo sumažinti atsilikimą, tačiau nugalėtojo klausimas buvo atsakytas dar gerokai prieš finalinę rungtynių sireną. Klaipėdiečiai iškovojo dar vieną pergalę –  39:27  – ir liko viena iš dviejų dar nepralaimėjusių lygos ekipų. (function(d, s, i, r) {
