		})(document, 'script', 'facebook-jssdk', 'fb-root'); „Savo komandos žaidimą vertinu labai prastai. Norisi greičiau grįžti namo ir eiti į sporto salę treniruotis, kad pakeistume viską į geresnę pusę. Nemačiau savo komandoje supykusio veido, žaidėjo, norinčio padėtį pakeisti, buvo truputį nuleistos galvos. Dėl to labai apmaudu. Važiuoti tris šimtus kilometrų tik dėl paties važiavimo, yra truputį skaudu. Net nenoriu dabar galvoti apie Tautvydo Damašausko traumą. Klaipėdos komandos gydytojas sako, kad prognozės nelabai geros. Grįšime į Vilnių, vyksime į ligoninę daryti tyrimų, tačiau noriu pagirti Klaipėdą, tikriausiai jie turi daug rungtynių, geras treniruotes, noriu palinkėti to ir mūsų komandai – yra iš ko mokytis“, – kalbėjo žaidžiantysis „Vilniaus“ treneris Petras Raupėnas. „Rungtynes pradėjome gana gerai, vėliau kiek sustojome. Gynyba pirmame kėlinyje tikrai tenkina, puolimas irgi pavyko. Su „Vilniumi“ žaidėme Supertaurės finale, tuomet buvo pati sezono pradžia, dar nebuvome gerai susižaidę, šiandien esame geresnėje formoje, dėl to laimėjome didesniu skirtumu“, - pridūrė „Dragūno“ žaidėjas Šarūnas Ugianskis. LRL čempionate pirmauja po 10 taškų surinkusios „Dragūno“, Kauno „Granito-Kario“ bei „Varsos-Stronglaso“ ekipos.
